import React, {useState, useEffect} from 'react'
import './App.css';
import Heading from './Reference JS/Header';
import BodyComponent from './Reference JS/Body';
import axios from 'axios'

function App() {

  const [data, setData] = useState([{}])

  const fetchAPI = async() => {
    const response = await axios.get("http://127.0.0.1:8080/api/members");
    console.log(response.data.members);
  };

  useEffect(() => {
    fetchAPI()
  }, []);


  return (
    <div className="App">
      <Heading />
      <BodyComponent />
    </div>
  );
}

export default App;
